.page-account {
    display: flex;
}

.page-account .code {
    display: flex;
    align-items: center;
    justify-content: center;
}

.page-account .code .pictrue {
    height: 40px;
    margin-left: 10px;
}

.swiperPross {
    border-radius: 6px 0px 0px 6px;
}

.swiperPross, .swiperPic, .swiperPic img {
    width: 510px;
    height: 100%;
}

.swiperPic img {
    width: 100%;
    height: 100%;
}

.container {
    height: 480px !important;
    padding: 0 !important;
    /*overflow: hidden;*/
    border-radius: 6px;
    z-index: 1;
    display: flex;
}

.containerSamll {
    /*width: 56% !important;*/
    background: #fff !important;
}

.containerBig {
    width: auto !important;
    background: #f7f7f7 !important;
}

.index_from {
    padding: 0 40px 0 40px;
    box-sizing: border-box;
}

.page-account-top {
    padding: 20px 0 !important;
    box-sizing: border-box !important;
    display: flex;
    justify-content: center;
}

.page-account-container {
    border-radius: 0px 6px 6px 0px;
}

.btn {
    background: linear-gradient(90deg, rgba(25, 180, 241, 1) 0%, rgba(14, 115, 232, 1) 100%) !important;
}

.captchaBox {
    width: 310px;
}

input {
    display: block;
    width: 290px;
    line-height: 40px;
    margin: 10px 0;
    padding: 0 10px;
    outline: none;
    border: 1px solid #c8cccf;
    border-radius: 4px;
    color: #6a6f77;
}

#msg {
    width: 100%;
    line-height: 40px;
    font-size: 14px;
    text-align: center;
}

a:link, a:visited, a:hover, a:active {
    margin-left: 100px;
    color: #0366D6;
}

.index_from >>> .ivu-input-large
    font-size:14px!important
.flex{
    display: flex;
}
.login_tab{
    font-size: 16px;
    margin:0 0 20px;
    justify-content: center;
}
.login_tab_item{
    width:50%;
    text-align:center;
    padding-bottom:15px;
    border-bottom:1px solid #eee;
    cursor :pointer;
}
.active_tab{
    border-bottom:2px solid #1495ED;
    color:#1495ED;
    font-weight:600;
}
.captch_input{
    width:200px;
}
.send_code{
    flex:1;
    border:1px solid #eee;
    cursor: pointer;
    margin-left: 10px;
}
.primary{
    color:#1495ED;
    font-size:12px;
    cursor: pointer;
}
.pull-right {
  float: right!important;
  .infoUrl{
    margin 0;
    color #515a6e !important;
  }
}
.footer{
  position: fixed;
  bottom: 0;
  width: 100%;
  left: 0;
  margin: 0;
  background: rgba(255,255,255,.8);
  border-top: 1px solid #e7eaec;
  overflow: hidden;
  padding: 10px 20px;
  height: 36px;
}
